import React from "react";
import StateButtons from "../TodoList/StateButtons";

const TodoList = ({ filtered, removeItem, changeStatus, IndexOfLastTodo, indexOfFirstTodo, editItem, currentTitle, setCurrentTitle, showInput, setShowInput }) => {
    return (
        <div className="todoList">
            {filtered.map((todo) => (
                <div key={todo.uuid}>
                    <StateButtons
                        removeItem={removeItem}
                        todo={todo}
                        changeStatus={changeStatus}
                        IndexOfLastTodo={IndexOfLastTodo}
                        indexOfFirstTodo={indexOfFirstTodo}
                        editItem={editItem}
                        currentTitle={currentTitle}
                        setCurrentTitle={setCurrentTitle}
                        showInput={showInput}
                        setShowInput={setShowInput}
                    />
                </div>
            ))}
        </div>
    );
};

export default TodoList;
